def writeJunction(f, exonBytes, readLenBytes, junc):
    # Write number of exons in junction
    writeVal(f, 1, len(junc.exons))

    # Write exons
    for e in junc.exons:
        writeVal(f, exonBytes, e)

    # Write NH and XS value (sign)
    if junc.xs == '+':
        NH = junc.NH
    else:
        NH = -junc.NH
    f.write(pack('b', NH))

    # More cost efficient to calculate/save the number of bytes needed for fragments for each junction
    maxFragLen = 0
    for l in junc.readLens.keys():
        if l > maxFragLen:
            maxFragLen = l
    fragLenBytes = findNumBytes(maxFragLen)
    writeVal(f, 1, fragLenBytes)

    writeLens(f, fragLenBytes, junc.readLens)
    if len(junc.readLens) > 0:
        if len(junc.lensLeft) == 0 and len(junc.lensRight) > 0:
            print('%d =/= %d' % (len(junc.lensLeft), len(junc.lensRight)))
        writeLens(f, readLenBytes, junc.lensLeft)
        if len(junc.lensLeft) > 0:
            writeLens(f, readLenBytes, junc.lensRight)
    else:
        if len(junc.lensLeft) > 0:
            print('Error! No frags, %d lens left' % junc.lensLeft)
    writeCov(f, RLE(junc.coverage))

def readJunction(f, exonBytes, readLenBytes, exons):
    # Read number of exons in junction
    numExons = readVal(f, 1)

    # Read exons
    junctionExons = []
    length = 0
    for _ in range(numExons):
        e = readVal(f, exonBytes)
        junctionExons.append(e)
        length += exons[e+1] - exons[e]

    # Initialize junction
    junc = junction.Junction(junctionExons, length)

    # Read NH and XS values
    NH = unpack('b', f.read(1))[0]
    if NH < 0:
        junc.xs = '-'
    else:
        junc.xs = '+'
    junc.NH = abs(NH)

    fragLenBytes = readVal(f, 1)

    junc.readLens = readLens(f, fragLenBytes)
    if len(junc.readLens) > 0:
        junc.lensLeft = readLens(f, readLenBytes)
        if len(junc.lensLeft) > 0:
            junc.lensRight = readLens(f, readLenBytes)
    junc.coverage = readCov(f)

    return junc

def writeLens(f, lenBytes, lens):
    # Write number of lengths
    writeVal(f, 2, len(lens))

    if len(lens) > 0:
        # Write number of bytes for each frequency
        freqBytes = findNumBytes(max(lens.values()))
        writeVal(f, 1, freqBytes)

        for l,n in lens.items():
            writeVal(f, lenBytes, l)
            writeVal(f, freqBytes, n)

def readLens(f, lenBytes):
    # Read number of lengths
    numLens = readVal(f, 2)
    lens = dict()

    if numLens > 0:
        # Read number of bytes for each frequency
        freqBytes = readVal(f, 1)

        for _ in range(numLens):
            l = readVal(f, lenBytes)
            n = readVal(f, freqBytes)
            lens[l] = n

    return lens

def writeCov(f, cov):
    maxLen = 0
    maxCov = 0
    for c in cov:
        if c[0] > maxCov:
            maxCov = c[0]
        if c[1] > maxLen:
            maxLen = c[1]

    # find length in bytes to fit all lengths
    lenBytes = findNumBytes(maxLen)

    # find length in bytes to fit all covs
    covBytes = findNumBytes(maxCov)

    # Write size of length and cov in bytes
    writeVal(f, 1, lenBytes)
    writeVal(f, 1, covBytes)

    # Write the length of the vector
    writeVal(f, 2, len(cov))

    for c in cov:
        writeVal(f, covBytes, c[0])
        writeVal(f, lenBytes, c[1])

def readCov(f):
    # Read size of length and cov in bytes
    lenBytes = readVal(f, 1)
    covBytes = readVal(f, 1)

    # Read the length of the vector
    lenCov = readVal(f, 2)

    cov = []
    for _ in range(lenCov):
        c = readVal(f, covBytes)
        l = readVal(f, lenBytes)
        #cov.append([l,c])
        cov += [c] * l

    return cov

def RLE(vector):
    rle = []

    val = vector[0]
    length = 0
    for v in vector:
        if v == val:
            length += 1
        else:
            rle.append([val, length])
            val = v
            length = 1
    rle.append([val, length])

    return rle

def findNumBytes(val):
    ''' Return the number of bytes needed to encode the given value.
        Will only return 1, 2, 4, or 8 (the number of bytes that struct.pack supports)
    '''

    if val <= 0:
        return 1
    else:
        return math.ceil(math.log(val+1, 2) / 8.0)

    if val <= 1:
        return 1
    else:
        b = math.ceil(math.log(val+1, 2) / 8.0)
        n = 1
        while n < b:
            n *= 2
        if n > 8:
            print('Error! Number is too large to write!')
        return n

